type Teststruct struct {
	Buf []byte
	Key string
}

// creates or appends a file map normally
func get_filemap(searchDir string) map[string][]byte {
	fileList := []string{}
	err := filepath.Walk(searchDir, func(path string, f os.FileInfo, err error) error {
		fileList = append(fileList, path)

		return nil
	})
	_ = err
	tilemap := map[string][]byte{}
	c := make(chan Teststruct)
	for _, i := range fileList {
		go func(i string, c chan Teststruct) {
			in, err := ioutil.ReadFile(i)
			if err != nil {
				//log.Print("err")
				in = []byte{}
			}
			c <- Teststruct{Buf: in, Key: i}
		}(i, c)

	}

	for range fileList {
		msg := <-c
		if len(msg.Buf) > 0 {
			tilemap[msg.Key] = msg.Buf
		}
	}

	return tilemap

}

